values:
Ever feel like life is out of your control.&nbsp; I know that most of it is, but it just feels like it today.&nbsp; I want so much, but I don't know where to start.&nbsp; I am so afraid of failing that I opt not to try.&nbsp; I need to push myself more.&nbsp; I am so scared of being on my own.&nbsp; I surround myself with people that are so fucken scared.&nbsp; Lazy, unproductive, school is coming up again.&nbsp; Again I will be test, I must push myself for if I fail, I must choose a new career path.&nbsp; I must prove myself wrong.&nbsp; I have to succeed.&nbsp; If I don't will be miserable with the person I have become.&nbsp; 
How long has it been since I wrote in a journal? 
I am in love and I'm scared
I am finally working on my AH BA
I like my job/I have a job
Why do I feel like things are going to come crashing down on me?
I must be good, I must wish good for others, I have to stop talking crap about people (it has been really hurting my soul, and it makes me a ugly person) I can feel the ugly sometimes when I'm talking shit.&nbsp; I don't want to be that person, I want to be better.&nbsp; I want a good clean soul.&nbsp; I want to be a person my niece can be proud of.&nbsp; I do not want to be like my sister.&nbsp; I want to be good.&nbsp; Happy, responsible, and not an over all disappointment.&nbsp; 
I must learn to stand on my own, with my lover or without him.&nbsp; I want to show myself that I can be on my own.&nbsp; 
I wish to be more grateful for all the opportunities given to me.&nbsp; For all the favors, gifts, lessons given to me. 
I am your servant, I come before you humbled&nbsp;
I must not fail, for if I do I would be failing myself
Please forgive my arrogance, as I hope to one day forgive myself.&nbsp; I have been cruel without reason, selfish, stubborn and ungrateful, weak, all this and more.&nbsp; I wish to be forgiven though I do know that I have not earn it.&nbsp; I want to be happy with myself, and thank you for all the obstacles that have put in my way to making me the person I am today.&nbsp; I know I have much to grow.&nbsp; I am open to growth.&nbsp; I welcome it, and fear it at the same time. This is my open letter to fate, destiny, or any other name for what drives the line which I follow. &nbsp;
Forgive me, as I will try to do for myself.&nbsp; Forgive yourself Lilly, Myrtle, BB Kitty, Duck, you are still just a child, but now you must act like as a woman.&nbsp; 
Love yourself for who you are, accept what you can not change and change what you can not accept.&nbsp; 
Corny I know, but it is true.&nbsp; 
Remember we learn more from our failing than our triumphs
so ends this rant
Me

I am so cool...you wish you were me.&nbsp; 
Myrtle: I am you..
Duckie: .........we's....dying....
Mari: &quot;Oooooooooooohhh baby we'll make heaven a place one earth&quot;
BB Kitty: &quot;Fuck ya'll&quot;

I want to think, but computer won't let me...
What is this about you may ask....well nothing really.
I wanted to chat for a bit, but really had nothing to say.
So I will talk to you about myself then.
I am now 25 years old, I still live with my parents. I have no job.&nbsp; I don't drive.&nbsp; I don't watch much television. I don't read as much as I should. And I just passed my English class :D.
I don't really know how to cook.&nbsp; I took a pottery class this year and had lots of fun.&nbsp; 
I have been with this one guy for about seven months straight, which is a record with this guy. 
Well I got nothing else to say for now. I am not feeling so bad about myself, that is why I don't update this thing as much as I use to.&nbsp;

How can two people love each other and still can&rsquo;t make their relationship work?&nbsp; I broke it off with Angel today.&nbsp; This time for good.&nbsp; He stopped wanting to hang out with me, and when we did hang out it was such a drag.&nbsp; But we love each other so much.&nbsp; I can&rsquo;t help but wonder why it didn&rsquo;t work out?&nbsp; The need to see each was gone.&nbsp; In truth I really didn&rsquo;t want to end.&nbsp; The thing is we didn&rsquo;t know how to make it better.&nbsp; We thought about taking a break but the really would not fix anything.&nbsp; So I decided&nbsp; to break it off. He agreed and that was the end of it.&nbsp; I feel so disappointed.&nbsp; I really want it to work out this time.&nbsp; It just makes me feels so sad.&nbsp; I mean I love him why didn&rsquo;t it work?&nbsp; He said he loved me too, he was near tears when he left my house.&nbsp; He kept hugging me but it was not working out for us.&nbsp; I think it is time to forget about being with him ever again.&nbsp; I need to move on a find a guy/girl that I can love anew and stay with.&nbsp; I am in so much pain right now.&nbsp; How I wish that it was not over, because I still love him very much.&nbsp; How I wish we could have been happy together, but after so many years if it is not working out then I have to just let it go.&nbsp; I deleted his number this time (from all the phones in my house), gave him back his rings,&nbsp; and anything else I had that was his.&nbsp; I said my goodbyes and watched from my window as he walked to his car and drove away.&nbsp; I just feel so sad.&nbsp; How am I going to get over him this time? How do you forget how much you loved someone. 
The same way they forget about you.&nbsp; He give get over you and by this time next year will be with another girl, maybe even in less time.&nbsp; Hell give him less then a month and he&rsquo;ll be dating again.&nbsp; I don&rsquo;t see why you should hold on to those feeling much longer.&nbsp; You are both better off this way.&nbsp; You will get over this just takes some time.&nbsp; Work out, get a job, go to school, anything that will get your mind off it.&nbsp; Go shopping, chicks like doing that, buy a shit load of clothes, shoes, make-up and go out.&nbsp; There that&rsquo;s the end of it.&nbsp; You&rsquo;ll be fine, trust me you always are in the end.&nbsp; Do not waste you time waiting for him to come back to you.&nbsp; Live your life and just forget about him.&nbsp; GO WATCH UNDER THE TUSCAN SUN! 
You&rsquo;re right, movies, games, movies, games, going out, more movies and game with some shopping.&nbsp; My old clothes no longer fits me anyways.&nbsp; Shoes, I am really starting to want more shoes. &nbsp;
So ends this rant. &nbsp;
